          Svenskt program fr&amp;aring;n 2005. PL4Y Dreamhack Summer tar dig
	  med bakom kulliserna p&amp;aring; v&amp;auml;rldens st&amp;ouml;rsta LAN-party,
	  datorspelsfestivalen Dreamhack. Den rymmer hobbyspelare,
	  som spelar f&amp;ouml;r skojs skull, men &amp;auml;ven elitspelare,
	  som t&amp;auml;vlar om hundratusentals kronor. Z TV visar
	  &quot;who's hot and who's not&quot; p&amp;aring; Sveriges gamingarena,
	  visar h&amp;ouml;jdpunkter, reportage och intervjuer med topgamers
	  s&amp;aring;som Johnathan &quot;Fatal1ty&quot; Wendel fr&amp;aring;n USA och Emil
	  &quot;HeatoN&quot; Christensen fr&amp;aring;n den svenska klanen NiP.
